var handleDataTableRowReorder = function () {
        "use strict";
        0 !== $("#data-table-rowreorder").length && $("#data-table-rowreorder").DataTable({
            responsive: !0,
            rowReorder: !0
        })
    },
    TableManageRowReorder = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableRowReorder()
            }
        }
    }();
